import './index.css';
import pic from "./Screenshot (54).png";
import pandas from "./panda.jpeg";

const name = "Narmeen";
//const img1 = "Screenshot (54).png";
//const img2 = "C:\frontend\mern\src\Screenshot (54).png";
//const img3 = "mern\src\Screenshot (54).png";

ReactDOM.render(
  <>
  <h1 className="heading">My name is {name}</h1>
  <div className="img_div">
  <img src= {pic } alt="randomimage" />

  <img src= {pandas} alt="randomimage" />

    <img src= {pic} alt="randomimage" />
    </div>

  </>,
  document.getElementById("root")

